code_brute_force.code:
class Solution:

    def distance(self, nums: List[int]) -> List[int]:
        arr = []
        n = len(nums)
        for i in range(n):
            distance_sum = 0
            for j in range(n):
                if i != j and nums[i] == nums[j]:
                    distance_sum += abs(i - j)
            arr.append(distance_sum)
        return arr

data_validator.code:
def is_valid_input(nums: List[int]) -> bool:
    if not isinstance(nums, list) or not nums:
        return False
    n = len(nums)
    if n < 1 or n > 10 ** 5:
        return False
    for num in nums:
        if not isinstance(num, int) or num < 0 or num > 10 ** 9:
            return False
    return True

