def random_test(max_length: int=10 ** 5, max_element: int=10 ** 9) -> List[Tuple[List[int]]]:
    random_inputs = []
    for _ in range(5):
        random_input = gen_input(max_length, max_element)
        random_inputs.append((random_input,))
